import React from 'react';
import {Link} from 'react-router-dom';

const NavBar = () => (
    <footer className="d-flex justify-content-between bg-secondary p-3" id="mainFooter">
        <div className="btn-group">
            <Link to="/" className="btn btn-outline-dark bg-light" exact={true}><i className="fa fa-minus-square"></i></Link>
            <Link to="/completed" className="btn btn-outline-dark bg-light" ><i className=""></i>Completed</Link>
            <Link to="/add-task" className="btn btn-outline-dark bg-light" exact={true}><i className=""></i>Add</Link>
        </div>
        <button className="btn btn-outline-dark bg-light"><i className=""></i>Delete</button>
    </footer>
)

export default NavBar
